import logo from './logo.svg';
import './App.css';

export default class App extends Component {

  componentDidMount(): void {
      console.log('App mounted');
  }

  render(): React.ReactElement {
    return (
      <div className="App">
        <h1 className=' text-green-700 cursor-pointer text-9xl font-bold text-left drop-shadow-2xl  bg-slate-100 p-4 rounded-t-3xl  hover:text-red-700 hover:shadow-2xl md:text-center m-10'>Asus</h1>
        <section className='grid grid-rows-4 grid-flow-col gap-4 bg-white m-10 p-10 rounded-b-3xl drop-shadow-2xl'>
        <aside className=' bg-red-800 p-3 font-bold text-red-100  hover:bg-green-700 hover:shadow-2xl'>1</aside>
        <aside className=' bg-red-700 p-3 font-bold text-red-200  hover:bg-green-700 hover:shadow-2xl'>2</aside>
        <aside className=' bg-red-600 p-3 font-bold text-red-300  hover:bg-green-700 hover:shadow-2xl'>3</aside>
        <aside className=' bg-red-500 p-3 font-bold text-red-400  hover:bg-green-700 hover:shadow-2xl'>4</aside>
        <aside className=' bg-red-400 p-3 font-bold text-red-500  hover:bg-green-700 hover:shadow-2xl'>5</aside>
        <aside className=' bg-red-300 p-3 font-bold text-red-600  hover:bg-green-700 hover:shadow-2xl'>6</aside>
        <aside className=' bg-red-200 p-3 font-bold text-red-700  hover:bg-green-700 hover:shadow-2xl'>7</aside>
        <aside className=' bg-red-100 p-3 font-bold text-red-800  hover:bg-green-700 hover:shadow-2xl'>8</aside>
        </section>

        {/* <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
